import React from "react";
import styled from "styled-components";

import Vegetables from "./Vegetables";

const Container = styled.div`
    width: 477px;

    background: blue;
    display: flex;
    flex-wrap: wrap;
`

const Garden = () => {
  return (
    <Container>
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />
      <Vegetables />

    </Container>
  );
};

export default Garden;
